import {useEffect} from "react";

function FetchChartMFIData({ stockCode, onChartMFIFetch }) {
    useEffect(() => {
        if (stockCode) {
            fetch(`http://127.0.0.1:8000/api/get_chart_MFI_data/${stockCode}/`)
                .then(response => {
                    if (!response.ok) {
                        throw new Error("Network response was not ok");
                    }
                    return response.json();
                })
                .then(data => {
                    if(onChartMFIFetch) {
                        onChartMFIFetch(data);
                    }
                })
                .catch(error => console.error('Error fetching ChartMFI data', error));
        }
    }, [stockCode]);
    return null;
}

export default FetchChartMFIData;
